script: |
  super -f text -I q1561.spq | sort > q1561.out

inputs:
  - name: q1561.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE NOT - col2 BETWEEN - col0 * 55 * - col0 + + col2 * - 23 AND - col1 * col2;
  - name: tab1

outputs:
  - name: q1561.out
    data: |
      51	14	96
      85	5	59
      91	47	68
